public class InnerSegmentDemographicFactory(Action<Humidifier.Pinpoint.SegmentTypes.Demographic> factoryAction = null) : SubResourceFactory<Humidifier.Pinpoint.SegmentTypes.Demographic>
{

    internal InnerSegmentSetDimensionFactory AppVersionFactory { get; set; }

    internal InnerSegmentSetDimensionFactory DeviceTypeFactory { get; set; }

    internal InnerSegmentSetDimensionFactory PlatformFactory { get; set; }

    internal InnerSegmentSetDimensionFactory ChannelFactory { get; set; }

    internal InnerSegmentSetDimensionFactory ModelFactory { get; set; }

    internal InnerSegmentSetDimensionFactory MakeFactory { get; set; }

    protected override Humidifier.Pinpoint.SegmentTypes.Demographic Create()
    {
        var demographicResult = CreateDemographic();
        factoryAction?.Invoke(demographicResult);

        return demographicResult;
    }

    private Humidifier.Pinpoint.SegmentTypes.Demographic CreateDemographic()
    {
        var demographicResult = new Humidifier.Pinpoint.SegmentTypes.Demographic();

        return demographicResult;
    }
    public override void CreateChildren(Humidifier.Pinpoint.SegmentTypes.Demographic result)
    {
        base.CreateChildren(result);

        result.AppVersion ??= AppVersionFactory?.Build();
        result.DeviceType ??= DeviceTypeFactory?.Build();
        result.Platform ??= PlatformFactory?.Build();
        result.Channel ??= ChannelFactory?.Build();
        result.Model ??= ModelFactory?.Build();
        result.Make ??= MakeFactory?.Build();
    }

} // End Of Class

